import React from 'react';

import {Accordion, card, button} from 'react-bootstrap';




const Faq = () => {
    return (       
  <header class="py-5">

  <Faq.Item eventKey="0">
    <Faq.Header>Quando acontecerá o lançamento do novo serviço?</Faq.Header>
    <Faq.Body>
    O lançamento oficial ocorrerá em 19/08/2021
    </Faq.Body>
  </Faq.Item>



</header>
    );
}

export default Faq;
